pragma solidity ^0.5.0;

contract Vacxpass{
    uint public taskcount=0;

    struct Task{
        uint id;
        string firstName;
        string lastName;
        string gender;
        string birthdate;
        string nic;
        string home;
    }
    struct secondTask{
        string vaccineId;
        string vaccineDate;
        string batchNumber;
        bool completed;
        string dateIssue;
    }
    struct code{
        string usercode;
    }
    mapping(uint=>Task) public tasks;
    mapping(uint=>secondTask) public vaccinetasks;
    mapping(uint=>code) public accesscode;

    event userTaskCreated(
        uint id,
        string firstName,
        string lastName,
        string gender,
        string birthdate,
        string nic,
        string home);
    
    event vaccineTaskCreated(
        string vaccineId,
        string vaccineDate,
        string batchNumber,
        bool completed,
        string dateIssue);

    event TaskCompleted(
        uint id,
        bool completed
    ); 
    event storecode(
        string usercode
    );   

    constructor()public{
        createTask("user firstName","user LastName","user gender","xx-xx-xxxx","user NIC","user address","0","xx-xx-xxxx","batch Number","xx-xx-xxxx");
    }
    function createTask(string memory firstName,string memory lastName,string memory gender,string memory birthdate,string memory nic,string memory home,string memory vaccineId,string memory vaccineDate, string memory batchNumber, string memory dateIssue)public{
        taskcount++;
        tasks[taskcount]=Task(taskcount,firstName,lastName,gender,birthdate,nic,home);
        vaccinetasks[taskcount]=secondTask(vaccineId,vaccineDate,batchNumber,false,dateIssue);
        emit userTaskCreated(taskcount,firstName,lastName,gender,birthdate,nic,home);
        emit vaccineTaskCreated(vaccineId,vaccineDate,batchNumber,false,dateIssue);
    }

    function toggleCompleted(uint _id) public {
        secondTask memory _task = vaccinetasks[_id];
        _task.completed = !_task.completed;
        vaccinetasks[_id] = _task;
        emit TaskCompleted(_id, _task.completed);
    }
    function setCode(string memory _code) public{
        accesscode[taskcount]=code(_code);
        emit storecode(_code);
    }
}
